import React from "react"
import "./featured.css"
import Feature from "./feature-data";

const featuring = Feature.map(feature=>{
    return(
      <Render 
            image={feature.img}
            name={feature.name}
            cost={feature.cost}
            />
    )
  })

function Render(props){
    return(
      <div id="featured-elements">
        <img src = {props.image} />
        <a>{props.name}</a>
        <p>{props.cost}</p>
        <div id="feature-buy">View More</div>
      </div>
    )
  }

  export default function Main(){
    return (
      <div id="Featured">        

        <a>Featured Products</a>
        <div id="featured-products">
          {featuring[0]}
          {featuring[1]}
          {featuring[2]}
        </div>

    </div>



    )
  }
